package syntaxtree;import visitor.BuildSymbolTableVisitor;import visitor.Visitor;import visitor.TypeVisitor;public class IntArrayType extends Type {	public IntArrayType() {}	public IntArrayType(Position p) {		position =p;	}  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }    public Type accept(BuildSymbolTableVisitor v){	  return new IntArrayType();  }    public String toString() {  	  return "int []";  }}